window.bookSummaryJSON = "<p><b>The Coast Guard must prevent the first lunar war in history.&nbsp;</b></p> <p>A lifelong search-and-rescuewoman, Coast Guard Captain Jane Oliver is ready for a peaceful retirement. But when tragedy strikes, Oliver loses her husband and her plans for the future, and finds herself thrust into a role she's not prepared for. Suddenly at the helm of the Coast Guard's elite SAR-1 lunar unit, Oliver is the only woman who can prevent the first lunar war in history, a conflict that will surely consume not only the moon, but earth as well.</p>"; 
